import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { Link, NavLink } from 'react-router-dom';
import { faAngleDoubleLeft } from '@fortawesome/free-solid-svg-icons';

const SideBar = () => {
  const [open, setOpen] = useState(true);
  const [menu, setMenu] = useState(false);
  const [dropdown, setDropdown] = useState(false);

  const openMenu = () => {
    setMenu(!menu);
  };

  const dropMenu = () => {
    setDropdown(!dropdown);
  };

  const navLinksStyles = ({ isActive }) => ({
    backgroundColor: isActive ? '#25253C' : '#1B1C22',
    border: isActive ? '1px solid rgba(0, 56, 255, 0.75)' : ' ',
    borderRadius: isActive ? '6px' : ' ',
    paddingLeft: isActive ? '0px' : ' ',
  });

  return (
    <div className="sidebar">
      <header className="flex fixed z-10">
        <nav
          className={`${open ? 'w-60' : 'w-30'} 
        h-screen p-5 pt-8 bg-[#1B1C22] duration-300 z-1 relative`}
        >
          <FontAwesomeIcon
            icon={faAngleDoubleLeft}
            className={`bg-[#14142B] rounded-full -right-3 border-dark-purple 
            absolute cursor-pointer top-9 w-7 border-2 ${
              !open && 'rotate-[180]'
            }`}
            onClick={() => setOpen(!open)}
          />
          <ul className="p-7 font-semibold flex-1 h-screen text-[18px]">
            <li className={`${open && 'hover:bg-light-white mb-[10px] hover:text-white rounded-md'} text-[18px] hover:opacity-[0.5] hover:text-white text-sm pb-7 items-center gap-x-4 p-2 pl-0`}>
              <NavLink to="/" style={navLinksStyles} className="flex gap-x-3 p-1 items-center" onClick={openMenu}>
                <img src={faAngleDoubleLeft} alt="Icon" className={`${!open && 'text-[20px]'} text-[18px]`} />
                <button type="button" className={`${!open && 'hidden'} text-[18px]`}>Application</button>
              </NavLink>
              {menu && (
                <>
                  <div className={`${!open && 'hidden'} ml-8 opacity-[0.6] text-[15px]`}>
                    <NavLink to="/instant-creditline/application/10percent-purchase" style={navLinksStyles}>
                      <button type="button" className="my-2">10% Purchase</button>
                    </NavLink>
                    <NavLink to="/instant-creditline/application/5percent-purchase" style={navLinksStyles} className="flex gap-x-5 items-center">
                      <p className="my-2">5% Purchase</p>
                    </NavLink>
                    <NavLink to="/instant-creditline/application/verification" style={navLinksStyles} className="flex gap-x-5 items-center">
                      <p className="my-2">Verification</p>
                    </NavLink>
                  </div>
                </>
              )}
            </li>
            <li className="hover:bg-light-white hover:text-white hover:opacity-[0.5] hover:text-white">
              <NavLink to="/instant-creditline/performance" style={navLinksStyles} className="flex gap-x-3 items-center p-1 " onClick={dropMenu}>
                <img src={faAngleDoubleLeft} alt="Icon" className={`${!open && 'text-[20px]'} pl-0`} />
                <button type="button" className={`${!open && 'hidden'}`}>Performance</button>
              </NavLink>
              {dropdown && (
                <>
                  <Link to="/instant-creditline/performance/exchange">
                    <button type="button" className="my-2 ml-8 opacity-[0.6] text-[15px]">Exchange</button>
                  </Link>
                </>
              )}
            </li>
            <li className="hover:bg-light-white hover:text-white hover:opacity-[0.5] hover:text-white">
              <NavLink to="/instant-creditline/repayment" style={navLinksStyles} className="flex gap-x-3 p-1 items-center my-[40px]">
                <img src={faAngleDoubleLeft} alt="Icon" className={`${!open && 'text-[20px]'} pl-0`} />
                <button type="button" className={`${!open && 'hidden'}`}>Repayment</button>
              </NavLink>
            </li>
            <Link to="/" className={`${!open && 'hidden'} origin-left duration-300 text-[16px] flex gap-x-5 items-center absolute top-[600px] bg-[#14142B] p-5 left-[10px]`}>
              <img src={faAngleDoubleLeft} alt="Film" className="w-5" />
              <p>Video Tutorials</p>
            </Link>
          </ul>
        </nav>
      </header>
    </div>
  );
};

export default SideBar;
